import React from 'react'
import { StyleSheet, Text, View, FlatList } from 'react-native'

const ListScreen = () => {
    const friends =[
        {id:1,name:'Subhas'},
        {id:2,name:'Arko'},
        {id:3,name:'Arup'},
        {id:4,name:'Arup1'},
        {id:5,name:'Arup2'},
        {id:6,name:'Arup3'},
        {id:7,name:'Arup4'},
        {id:8,name:'Arup5'},
        {id:9,name:'Arup6'},
        {id:10,name:'Arup7'},
    ]
    return (
        <View>
            <FlatList
                keyExtractor={item => item.id}
                data={friends}
                renderItem={({ item }) => {
                    return <Text>{item.name}</Text>
                }}
            
            />
        </View>
    )
}

export default ListScreen

const styles = StyleSheet.create({})
